import multiprocessing
def read_files(data_path, dataset_name, annotation_config_path):
    os.chdir(data_path)
    import json
    with open(f"{data_path}/{dataset_name}", "r") as rds:
        dataset = json.load(rds)
    entities = parse_annotator_config(annotation_config_path, data_path)
    import glob
    txtFiles = glob.glob('*.txt')
    file_names_prefixes = [x.split(".")[0] for x in txtFiles]
    print(f"fetched file name prefixes\n {file_names_prefixes} \n")
    files_to_process = []
    for file_names_prefix in file_names_prefixes:
    #for file_names_prefix in filtered_data_points_str:
        if (file_names_prefix in all_points) and (file_names_prefix not in filtered_data_points):
            txt_file = f"{file_names_prefix}.txt"
            ann_file = f"{file_names_prefix}.ann"
            file_obj = {
                "txt_file" : txt_file,
                "ann_file" : ann_file,
                "prefix" : file_names_prefix
            }
            files_to_process.append(file_obj)
        else:
            print(f"skipping {file_names_prefix} due to some error")
            skipped_points.append(file_names_prefix)
    # print("processed file names")
    # print(files_to_process)

    results = []
    for obj in files_to_process:
        res = process_each_question(obj, dataset, entities)
        if res :
            results.append(res)
    print(f' no of data points extracted : {len(results)}')
    import time
    t = int(time.time())
    print(f"save final dataset to dir started. time {t}")
    #final_ds = json.dump(results)
    final_file_name = f"{data_path}/dataset_{t}.json"
    with open(final_file_name,"w") as dsf :
        json.dump(results, dsf)
        #dsf.write(final_ds)
    print(f"save final dataset to dir ended. time {int(time.time())} , file name {final_file_name}")


def process_each_question(file_obj, dataset, entities):
    data_point = {
        "uri": "",
        "question":"",
        "context":"",
        "answers":[],
        "labelled_answer_spans":[],
        "labelled_summaries":[]
    }
    txt_file = file_obj['txt_file']
    ann_file = file_obj['ann_file']
    try:
        txt_content = ""
        ann_context = ""
        with open(txt_file, 'r') as txt_file_fd:
            txt_content = txt_file_fd.read()
            #print(f"Content of {txt_file}:\n{txt_content}")
        with open(ann_file, 'r') as ann_file_fd:
            ann_content = ann_file_fd.readlines()
            #print(f"Content of {ann_file}:\n{ann_content}")

        q = next(obj for obj in dataset if obj["uri"] == file_obj["prefix"])

        if q is not None:
            data_point["uri"] = file_obj["prefix"]
            data_point["question"] = q["subject"]
            data_point["context"] = q["content"] if "content" in q else ""
            data_point["answers"] =q["nbestanswers"]
            data_point["raw_text"] = txt_content

            labelled_answer_spans = ""
            selected_entities = [ x for x in entities if ("_SUMMARY" not in x) and x != "INVALID"]
            summ = {}
            for i in ann_content:
                entry = i.split("\t")  # split each line of the annotation file column wise
                if data_point['uri'] == "1660415":
                    print(f'hehe \n{i}')
                    print(f'{entry}')
                entity = entry[1].split(" ")[0]  # each line looks like 'T10\tQUESTION 0 8\turi : 18\n'
                if entity in selected_entities:
                    start_label_index = int(entry[1].split(" ")[1])
                    end_label_index = int(entry[1].split(" ")[2])
                    #data_point["label_spans"] = [start_label_index, end_label_index]
                    label_spans = [start_label_index, end_label_index]
                    selected_span = entry[2].strip()  # remove newlines
                    if entity in summ:
                        summ[entity].append({"txt":selected_span, "label_spans": label_spans})
                    else:
                        summ[entity] = []
                        summ[entity].append({"txt":selected_span, "label_spans": label_spans})
                elif entity == "INVALID":
                    id = file_obj["prefix"]
                    print(f"invalid {id}")
                    # print(f"some entity in annotation file which doesn't exist in annotation config {entity}")
                    # could be an invlaid entity , SUMMARY type or INVALID data point
                    return None
                else:
                    continue
                    #raise Exception(f"some entity in annotation file which doesn't exist in annotation config {entity}")
            data_point["labelled_answer_spans"] = summ

            labelled_summaries = {}

            selected_summ_entities = [ x for x in entities if ("_SUMMARY") in x]
            summary = {}
            for i in ann_content:
                entry = i.split("\t")  # split each line of the annotation file column wise
                id = entry[0]
                entity = entry[1].split(" ")[0]  # each line looks like 'T10\tQUESTION 0 8\turi : 18\n'
                if entity in selected_summ_entities:
                    summary[id] = entity
                elif entity == "AnnotatorNotes":
                    anno_id = entry[1].split(" ")[1].strip()
                    labelled_summaries[summary[anno_id]] = entry[2].strip()

            data_point["labelled_summaries"] = labelled_summaries

    except FileNotFoundError:
        print(f"File(s) not found: {file_obj}")
        raise Exception("aborting ... ")
    except Exception as e:
        print(f"Error processing some file(s) from {file_obj}: {str(e)} uri {file_obj['prefix']}")
        raise Exception("aborting ... ")
    return data_point

def parse_annotator_config(annotation_config_path, data_path):
    text = ""
    with open(f"{annotation_config_path}", "r") as cfg:
        text = cfg.read()
    # Split the text into lines
    lines = text.split('\n')

    # Initialize flags to indicate when to start and stop collecting lines
    start_collecting = False
    stop_collecting = False
    # Initialize an empty list to store the collected lines
    collected_lines = []
    # Iterate through the lines and collect lines between [entities] and [relations]
    for line in lines:
        line = line.strip()  # Remove leading and trailing whitespace
        if line and not line.startswith('#'):  # Skip empty lines and lines starting with #
            if start_collecting and not stop_collecting:
                if line == '[relations]':
                    stop_collecting = True
                else:
                    collected_lines.append(line)
            elif line == '[entities]':
                start_collecting = True
    # Print the collected lines
    entities = []
    for line in collected_lines:
        entities.append(line)
    return entities

